import React from 'react';
import "./index.css"
import { BrowserRouter } from 'react-router-dom'; // Import BrowserRouter, Routes, and Route

/*function App() {
  return (
      <div>
        <h1>Hi, welcome to the Home Page!</h1>
        {/* You can add other routes or components here *//*}
      </div>
  );
}
*/
function App() {
  const [events] = useState([
    { id: 1, title: 'Event 1', date: '2025-02-10' },
    { id: 2, title: 'Event 2', date: '2025-02-12' },
    { id: 3, title: 'Event 3', date: '2025-02-14' },
  ]);

  return (
    <div className="App">
      {/* Header Section */}
      <header className="header">
        <div className="contact-info">
          <p>Contact Us: contact@yourdomain.com</p>
        </div>
        <div className="login-signin">
          <button>Login</button>
          <button>Sign Up</button>
        </div>
        <div className="donation-bar">
          <p>Donate Now!</p>
          <button>Donate</button>
        </div>
      </header>

      {/* Main Content */}
      <main className="main-content">
        {/* Pictures Section (Top Middle) */}
        <div className="image-gallery">
          <img src="https://via.placeholder.com/300x200" alt="Picture 1" />
          <img src="https://via.placeholder.com/300x200" alt="Picture 2" />
          <img src="https://via.placeholder.com/300x200" alt="Picture 3" />
        </div>

        {/* Events Section (Bottom) */}
        <section className="events">
          <h2>Upcoming Events</h2>
          <ul>
            {events.map((event) => (
              <li key={event.id}>
                <h3>{event.title}</h3>
                <p>Date: {event.date}</p>
              </li>
            ))}
          </ul>
        </section>
      </main>
    </div>
  );
}
export default App;
